const axios = require("axios");
let x = ""
const postData = {
  jsonrpc: "2.0",
  id: 1,
  method: "timestampvm.proposeBlock",
  params: [{ data: x.repeat(3)}],
};
const url =
  "http://127.0.0.1:9650/ext/bc/2WC7br6Ubp2ysX7cBXjmzyk56NsRN9Sr6YQc1QKTeCgJ2nYLbz/rpc";
const headers = {
  "Content-Type": "application/json",
};

function start() {
  axios
    .post(url, postData, { headers })
    .then((response) => {
      console.log(response.data);
    })
    .catch((error) => {
      console.error(error);
    })
    .then(() => {
      setTimeout(start, 1000);
    });
}
start();
